import React from 'react'

const Card = ({ children }) => {
    return (
      <div className="bg-white shadow-lg hover:shadow-2xl transition-shadow duration-300 rounded-2xl p-6 w-full max-w-3xl">
        {children}
      </div>
    );
  };
  
  const CardLayout = ({ leftContent, rightContent }) => {
    return (
      <div className="flex justify-center items-center min-h-screen bg-gray-100 p-4">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6 w-full max-w-6xl">
          <Card>{leftContent}</Card>
          <Card>{rightContent}</Card>
        </div>
      </div>
    );
  };

export default CardLayout
